node.documentation:
GEMMA Softwarecatalogus

Gemeenten gebruiken de GEMMA Softwarecatalogus bij ICT-vervangings- of investeringsvraagstukken. Zij vergelijken hun ingevoerde applicatielandschap en koppelingen met anderen en zoeken contact met vergelijkbare gemeenten.  Voorbeelden hiervan zijn:

► Marktoriëntatie voor nieuwe of vervangende software;
► Vergelijken met andere gemeenten;
► Contact leggen met gemeenten met vergelijkbaar of interessant productportfolio;
► Het plannen van ICT-vervangingen;
► Het opstellen van een Programma van Eisen;
► Het beoordelen van offertes
